import React, { Component } from 'react';
import 'assets/css/estilos.css';

class App extends Component {
  render() {
    return (
      <div className="main">
        <header className="main-header">
          <h1>Mundi Oculos</h1>
          <h2>Saiba para onde os olhos do mundo estão direcionados.</h2>
          <h3>Mundi Oculos (do Latim “Olhos Do Mundo”) é uma ferramenta que permite ao usuário acompanhar o crescimento do interesse de uma determinada região sobre um determinado tema com base na publicação De Notícias Em Noticiários Locais Sobre O Referido.</h3>
        </header>
      </div>
    );
  }
}

export default App;
